import React, { useState, useEffect } from 'react';
import axios from 'axios';



const MainPage = () =>{
    const [Books, setBooks] = useState(null);

    useEffect(() => {
        const fetchBooks = async () => {
            const fetchBooks = async () => {
                try {
                    const response = await axios.get('');
                    setBooks(response);
                    
                  } catch (error) {
                    console.error('Error fetching books', error);
                  }
    
            }
        };

        fetchBooks();
    }, []);

    if (!Books) return <p> Loading.. </p>;

    return(
        <div class="wrapper ">
        <div class="sidebar"   data-background-color="black" data-image="./assets/img/sidebar-2.jpg">
          <div class="logo">
            <a href="http://www.creative-tim.com" class="simple-text logo-normal">
              ShelfSync
            </a>
          </div>
          <div class="sidebar-wrapper">
            <ul class="nav">
              <li>
                <a class="nav-link" href="javascript:void(0)" data-color="purple">
                  <i class="material-icons">library_books</i>
                  <p>Library</p>
                </a>       
              </li>
              <li>
                <a class="nav-link" href="javascript:void(1)">
                  <i class="material-icons">content_paste</i>
                  <p>List View</p>
                </a>
              </li>
              <li>
                <a class="nav-link" href="javascript:void(2)">
                  <i class="material-icons">dashboard</i>
                  <p>Add New</p>
                </a>
              </li>
              <li>
                <a class="nav-link" href="javascript:void(3)">
                  <i class="material-icons">person</i>
                  <p>Settings</p>
                </a>
              </li>
            </ul>
          </div>
        </div>
        <div class="main-panel">
          <nav class="navbar navbar-expand-lg navbar-transparent navbar-absolute fixed-top ">
            <div class="container-fluid">
              <div class="navbar-wrapper">
                <a class="navbar-brand" href="javascript:void(0)">Dashboard</a>
    
              </div>
              <button class="navbar-toggler" type="button" data-toggle="collapse" aria-controls="navigation-index" aria-expanded="false" aria-label="Toggle navigation">
                <span class="sr-only">Toggle navigation</span>
                <span class="navbar-toggler-icon icon-bar"></span>
                <span class="navbar-toggler-icon icon-bar"></span>
                <span class="navbar-toggler-icon icon-bar"></span>
              </button>
              <div class="collapse navbar-collapse justify-content-end">
                <ul class="navbar-nav">
                  <li class="nav-item">
                    <a class="nav-link" href="javascript:void(0)">
                      <i class="material-icons">notifications</i>
                      <p class="d-lg-none d-md-block">
                        Notifications
                      </p>
                    </a>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
          <div class="content">
            <div class="container-fluid">
            </div>
          </div>
          </div>
          </div>
    );


};


export default MainPage;
